import React, { Component } from "react";
import "./App.css";
import Navbar from "./Components/Navbar";
import Section from "./Components/Section";
import dummyText from "./DummyText";

class App extends Component {
  render() {
    return (
      <div className="App" class="clearfix">
        <Navbar />

          {/* title="Section 1" */}
          {/* subtitle={textContents} */}
          {/* dark={true} */}
          {/* id="section1" */}

        <div className={"section" + (false ? " section-dark" : "")}>
          <div className="section-content" id="section1" >
            <h1>Hello Piyush</h1>
            <p align="centre">
              We at Innovate thank you for your time. <br/><br/><br/><br/>

              In an ever-changing world, we grow and adapt daily to thrive and excel. <br/><br/><br/><br/>

              Developing technology provides countless opportunities for growth. <br/><br/><br/><br/>

              All that’s left now is for us to realize them.<br/><br/><br/><br/>

              You’ve taken the first step by trusting us at Innovate. <br/><br/><br/><br/>

              Now let us help you.
            </p>
          </div>
        </div>

        <Section
          title="Section 2"
          subtitle={dummyText}
          dark={true}
          id="section2"
        />
        <Section
          title="Section 3"
          subtitle={dummyText}
          dark={false}
          id="section3"
        />
        <Section
          title="Section 4"
          subtitle={dummyText}
          dark={true}
          id="section4"
        />
        <Section
          title="Section 5"
          subtitle={dummyText}
          dark={false}
          id="section5"
        />
      </div>
    );
  }
}

export default App;
